 - dependent cholesterol efflux from mouse primary hepatocytes , and this effect was shown to be responsible for the effect of probucol on increasing the fecal excretion of HDL-derived cholesterol in vivo . CONCLUSIONS : We demonstrate that pharmacological inhibition of hepatic

 activity with probucol reduced HDL-C levels but promoted RCT through diversion of HDL-derived cholesterol from efflux back into plasma instead to excretion in the bile . These results explain the beneficial effects of probucol on atherosclerosis and xanthomas despite its HDL-lowering effects and suggest that inactivation of hepatic

<h2 style="margin: 0">4</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Serotonin : a local regulator in the mammary gland epithelium . Serotonin ( 5 - hydroxytryptamine , 5 - HT ) is a very simple molecule that plays key roles in complex communication mechanisms within the animal body . In the mammary glands , serotonin biosynthesis and secretion are induced in response to dilation of the alveolar spaces . Since its discovery several years ago , mammary 5 - HT has been demonstrated to perform two homeostatic functions . First , serotonin regulates lactation and initiates the transition into the earliest phases of involution . Second , serotonin is a local signal that induces parathyroid hormone-related peptide ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P12272
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) , which allows the mammary gland to drive the mobilization of calcium from the skeleton . These processes use different receptor types , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P34969
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and 5 - HT2 , respectively . In this review , we provide synthetic perspectives on the fundamental processes of lactation homeostasis and the adaptation of calcium homeostasis for lactation . We analyze the role of the intrinsic serotonin system in the physiological regulation of the mammary glands . We also consider the importance of the mammary serotonin system in pathologies and therapies associated with lactation and breast cancer .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Design and synthesis of 3,5- disubstituted -1,2 , 4 - oxadiazoles as potent inhibitors of phosphodiesterase 4b2 . A series of 3,5- disubstituted -1,2 , 4 - oxadiazoles has been prepared and evaluated for phosphodiesterase inhibition ( PDE 4B2 ) . Among the prepared 3,5- disubstituted -1,2 , 4 - oxadiazoles , compound 9a is the most potent inhibitor ( PDE 4B2 IC ( 50 ) = 5.28 μm ) . Structure-activity relationship studies of 3,5- disubstituted -1,2 , 4 - oxadiazoles revealed that substituents 3 - cyclopentyloxy - 4 - methoxyphenyl group at 3 - position and cyclic ring bearing heteroatoms at 5 - position are important for activity . Molecular modeling study of the 3,5- disubstituted -1,2 , 4 - oxadiazoles with

<h2 style="margin: 0">6</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Functional methionine synthase deficiency ( cblE and cblG ) : clinical and biochemical heterogeneity . Functional methionine synthase deficiency is generally characterized by homocystinuria and hypomethioninemia in the absence of methylmalonic aciduria . Patients are divided into two classes , cblE and cblG , on the basis of complementation analysis . Presentation has usually been in the first 2 years of life , but one patient came to medical attention at age 21 years with symptoms initially diagnosed as multiple sclerosis . Common findings among 11 patients ( 4 with cblE and 7 with cblG ) have included megaloblastic anemia ( all patients ) and various neurological deficits including developmental retardation ( 10 patients ) , cerebral atrophy ( 8 patients ) , hypotonia ( 7 patients ) , EEG abnormalities ( 6 patients ) , and nystagmus ( 5 patients ) . Hypertonia , seizures , blindness , and ataxia were less frequent . All patients have responded to therapy with cobalamin with resolution of anemia and biochemical abnormalities ; neurological deficits resolved more slowly and in some cases incompletely . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 has been more effective than cyanocobalamin . Fibroblasts from patients with cblE ( 5 patients ) and cblG ( 6 patients ) all showed decreased intracellular levels of methylcobalamin ( DB03614 ) and decreased incorporation of label from 5 - methyltetrahydrofolate into macromolecules , suggesting decreased activity of the DB03614 - dependent enzyme methionine synthase . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q99707

</mark>
 specific activity in extracts of all cblE fibroblasts was normal or near-normal under standard reducing conditions ; synthase specific activity in extracts of 5 cblG patients was low but was high in a 6th patient measured in another laboratory . Thus , there is heterogeneity among patients with functional methionine synthase deficiency both in clinical presentation and in the results of biochemical studies of cultured cells .</div>

 . These studies were performed on M13 phage DNA templates of defined sequence . The results demonstrate that ara-C is incorporated into DNA by

<div class="entities" style="line-height: 2.5; direction: ltr">Interactions between genetic variants of folate metabolism genes and lifestyle affect plasma homocysteine concentrations in the Boston Puerto Rican population . OBJECTIVE : To investigate genetic and lifestyle factors and their interactions on plasma homocysteine ( Hcy ) concentrations in the Boston Puerto Rican population . DESIGN : Cross-sectional study . Plasma concentrations of Hcy , folate , vitamin B12 and pyridoxal phosphate were measured , and genetic polymorphisms were determined . Data on lifestyle factors were collected in interviews . SETTING : A population survey of health and nutritional measures . SUBJECTS : A total of 994 Puerto Rican men and women residing in the Boston metropolitan area . RESULTS : Smoking status was positively associated with plasma Hcy . Genetic polymorphisms
